import logo from './images/Vector.svg';
import './index.css';

function App() {
  return (
    <div>
    <div className="App">
      <header className="App-header">
        <img src={logo} className="header__logo" alt="logo" />
      </header>
    </div>
    </div>
  );
}

export default App;
